import React from "react";
import "./Navbar.scss";
import { images } from "../../constants";

const Navbar = () => {
  return (
    <nav>
      <div>
        <img src={images.logo} alt="logo" />
        <ul>
          //loop through all elements
          {["home", "a"]}
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
